import {useState} from "react";
import {Button} from "react-bootstrap";

function Job({job}) {
    const [cur, setCur] = useState('무관');

    return (
        <div>
            <p>직업</p>
            <Button
                id="직업무관"
                className={(cur === '무관' ? "activeButton" : "inactiveButton")}
                onClick={() => setCur('무관')}
            >
                무관
            </Button>
            {job.map(j =>
                <Button
                    id={j}
                    className={(cur === j ? "activeButton" : "inactiveButton")}
                    onClick={() => setCur(j)}
                >
                    {j}
                </Button>
            )}
        </div>
    )
}

export default Job;
